import React from 'react';
import { MDBNavbar, MDBNavbarBrand, MDBNavbarNav, MDBNavbarToggler, MDBCollapse, MDBNavItem, MDBNavLink, MDBContainer, MDBMask, MDBView, MDBLink, MDBDocs } from 'mdbreact';
import { BrowserRouter as Router } from 'react-router-dom';
import FooterPage from './footer.js'
import Gallery from './Gallery'


class FullPageIntroWithFixedTransparentNavbar extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      collapse: false,
      isWideEnough: false,
      activeItemPills: '1'
    };
    this.onClick = this.onClick.bind(this);
  }

  onClick() {
    this.setState({
      collapse: !this.state.collapse,
    });
  }
  togglePills = tab => () => {
    const { activePills } = this.state;
    if (activePills !== tab) {
      this.setState({
        activeItemPills: tab
      });
    }
  };
  render() {
    return (
      <div>
        <header>
          <Router>
            <MDBNavbar color="bg-primary" fixed="top" dark expand="md" scrolling transparent>
              <MDBNavbarBrand href="/">
                <strong>Navbar</strong>
              </MDBNavbarBrand>
              {!this.state.isWideEnough && <MDBNavbarToggler onClick={this.onClick} />}
              <MDBCollapse isOpen={this.state.collapse} navbar>
                <MDBNavbarNav left>
                  <MDBNavItem active>
                  <MDBLink to='#' active={activeItemPills === '1'} onClick={this.togglePills('1')} link>
                      Home
                  </MDBLink>
                  </MDBNavItem>
                  <MDBNavItem>
                    <MDBNavLink to="#">Link</MDBNavLink>
                  </MDBNavItem>
                  <MDBNavItem>
                    <MDBNavLink to="#">Profile</MDBNavLink>
                  </MDBNavItem>
                  <MDBNavItem>
                  <MDBLink to='#' active={activeItemPills === '2'} onClick={this.togglePills('2')} link>
                      Home
                  </MDBLink>
                  </MDBNavItem>
                </MDBNavbarNav>
              </MDBCollapse>
            </MDBNavbar>
            <MDBTabContent activeItem={activeItemPills}>
                  <MDBTabPane tabId='1'>
                  <p>
                      Ad pariatur nostrud pariatur exercitation ipsum ipsum culpa mollit commodo mollit ex. Aute sunt incididunt amet
                      commodo est sint nisi deserunt pariatur do. Aliquip ex eiusmod voluptate exercitation cillum id incididunt elit sunt.
                      Qui minim sit magna Lorem id et dolore velit Lorem amet exercitation duis deserunt. Anim id labore elit adipisicing ut
                      in id occaecat pariatur ut ullamco ea tempor duis.
                    </p>
                  </MDBTabPane>
                  <MDBTabPane tabId='2'>
                    <Gallery/>
                  </MDBTabPane>
                  <MDBTabPane tabId='3'>
                  </MDBTabPane>
                </MDBTabContent>
          </Router>
          </header>
          </div>


    );
  }
}

export default FullPageIntroWithFixedTransparentNavbar;
